import React,{ useEffect } from 'react';
import classes from './NavBar.module.css';
import AccountStatement from '../Accounts/AccountStatement';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
} from "react-router-dom";

const DummyAccounts = [
	{id: "1", name:"Salman"},
	{id: "2", name:"Ali"},
	{id: "3", name:"Nobahar"}
];

function NavBar(props)	{

	return (
		<>
		 <button onClick={props.logout}>Logout</button>
			<Router>
					<NavLink to="/">All Account</NavLink>			
				{   
					DummyAccounts.map(account => (
						<NavLink key={account.id} to={"/AccountStatement/" + account.name}>{account.name}</NavLink>
					))
				}
				<Routes>
						<Route exact path="/AccountStatement/:accountId" element={<AccountStatement  />}  />
				</Routes>
			</Router>
			</>
	)
}

export default NavBar;
